import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, ImageBackground} from 'react-native';
import AppButton from '../components/MyButton';
import NewButton from '../components/button.js';

export default function Home({ navigation }) {
    return (
        <ImageBackground source={{uri: 'https://i.pinimg.com/564x/64/31/35/643135e60d9de9543ade17d3b96fff8a.jpg'}} style={styles.backgroundImage}>
        <View style = { styles.container } > 
        <Text style={styles.title}>Movie Hub</Text>
        <br></br>
        <Text style={styles.header}> Sign up to find streaming links to your movie of choice</Text> 
        <AppButton />   
        <NewButton buttonText="Enter"></NewButton> 
        </View>
        </ImageBackground>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems: 'center',
        //backgroundColor: 'black',
        justifyContent: 'center',
    },
    title: {
        color: 'yellow',
        fontWeight: 'bold',
        fontSize: 50,
    },
    header: {
        color: "yellow",
        fontWeight: "bold",
        fontSize: 20,
    },
    subheader: {
        color: "black",
        fontSize: 16,
    },
    text: {
        color: "black",
        fontSize: 14,
    }

});
